import { user } from './user'
@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  user:user[]=[
    {id:1, name:'firas'},
    {id:2,name:'hamza'}
  ];
}
